import React from "react";
import "./AboutMe.css";
import allc from "../assets/allc.png";
import androidstudio from "../assets/androidstudio.png";
import claymation_me from "../assets/claymation_me.png";
import dart from "../assets/dart.png";
import figma from "../assets/figma.png";
import flutter from "../assets/flutter.png";
import godot from "../assets/godot.png";
import java from "../assets/java.png";
import js from "../assets/js.png";
import linux from "../assets/linux.png";
import me from "../assets/me.png";
import postman from "../assets/postman.png";
import python from "../assets/python.png";
import swift from "../assets/swift.png";
import unity from "../assets/unity.png";
import vscode from "../assets/vscode.png";
import xcode from "../assets/xcode.png";

const AboutMe = () => {
  return (
    <div className="about-me">
      <div className="text-and-button">
        <div style="width: 765px; height: 450px; position: relative; box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25)">
          <div style="width: 725px; height: 85px; padding-top: 8px; padding-bottom: 9px; padding-left: 88px; padding-right: 86.20px; left: 20px; top: 339px; position: absolute; background: rgba(56, 216, 126, 0.80); box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25); border-radius: 15px; overflow: hidden; justify-content: center; align-items: center; display: inline-flex">
            <div style="width: 550.80px; height: 68px; text-align: center; color: white; font-size: 28px; font-family: Consolas; font-weight: 700; word-wrap: break-word">GO AHEAD, YOU KNOW YOU WANT TO!
          </div>
        </div>
          <div style="width: 765px; height: 165px; left: 0px; top: 118px; position: absolute; text-align: justify; color: #DEDEEE; font-size: 28px; font-family: Consolas; font-weight: 400; line-height: 34px; letter-spacing: 0.56px; word-wrap: break-word">Firstly, thank you for visiting my site! I am a full stack developer with a Bachelor’s Degree in Computer Science — Computer Game Design from the University of Massachusetts Dartmouth. Press the button below to launch a random project of mine. </div>
          <div style="width: 765px; height: 106.25px; left: 0px; top: 0px; position: absolute; color: white; font-size: 64px; font-family: Raleway; font-weight: 700; word-wrap: break-word">Hi! I’m Andrew Napier</div>
        </div>
      </div>
      <div className="image-grid">
        {[allc, androidstudio, claymation_me, dart, figma, flutter, godot, java, js, linux, me, postman, python, swift, unity, vscode, xcode].map((img, index) => (
          <img key={index} src={img} alt={`Gallery ${index + 1}`} className="about-img" />
        ))}
      </div>
    </div>
  );
};

export default AboutMe;
